import { Text, View } from 'react-native'
import React, { Component } from 'react'
import Icon from 'react-native-ico-material-design';
import Pressable from 'react-native/Libraries/Components/Pressable/Pressable';

export default function Tab_navigator() {
 
    return(
        <>
          <View style={styles.NavContainer}>
              <View style={styles.NavBar}>
                 
                   <Pressable onPress={() => this.changeText('Favourites')} style={styles.IconBehave}
                     android_ripple={{borderless:true, radius:50}}>
                     <Icon name="favorite-heart-button" height={iconHeight} width={iconHeight} color='#448af'/>
                   </Pressable>
                
              </View>
          </View>
        </>
    )
}

const styles = StyleSheet.create({

    container: {

        flex: 1, 
        backgroundColor: '#3962ff',
        alignItems: 'center',
        justifyContent: 'center',

    },

    NavContainer:{
       
        position: 'absolute',
        alignItems:'center',
        bottom:'20',

    },

    NavBar:{

        flexDirection:'row',
        backgroundColor:'#eee',
        width: '90%',
        justifyContent:'space-evenly',
        borderRadius: 40,

    },

    IconBehave: {

        padding: 14,

    },
});
